Bio: I have been dancing professionally for a long time. I like very much to study different areas of dance. I also love photography and I am particularly inspired by the beautiful posters. I have a lot of different clothes and jewelry. My dream is to travel around the world. I am impressed by the warm exotic destinations and sea food. I love to eat sushi and fish in various forms. I love men and I enjoy it when I am looked after and given flowers. I love romantic walks under the moon and night swimming naked. I am madly in love young children and in the future I want a big happy family.
